INSERT INTO `wp_posts` VALUES (1,1,'2017-08-15 11:16:43','2017-08-15 11:16:43','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','trash','open','open','','hello-world__trashed','','','2018-08-27 17:46:10','2018-08-27 17:46:10','',0,'http://192.168.229.129/wordpress/?p=1',0,'post','',1),(2,1,'2017-08-15 11:16:43','2017-08-15 11:16:43','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://192.168.229.129/wordpress/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','trash','closed','open','','sample-page__trashed','','','2018-08-27 18:50:58','2018-08-27 18:50:58','',0,'http://192.168.229.129/wordpress/?page_id=2',0,'page','',0),(5,1,'2017-08-19 05:28:45','2017-08-19 05:28:45','[hello]','Demo','','trash','closed','closed','','demo__trashed','','','2018-08-27 18:50:57','2018-08-27 18:50:57','',0,'http://192.168.229.129/wordpress/?page_id=5',0,'page','',0),(6,1,'2017-08-19 05:28:45','2017-08-19 05:28:45','[hello]','Demo','','inherit','closed','closed','','5-revision-v1','','','2017-08-19 05:28:45','2017-08-19 05:28:45','',5,'http://192.168.229.129/wordpress/index